import Nav from '../layout/Nav';
import Register from './RegisterUser';
import Alert from '../layout/Alert';
import Cookies from 'js-cookie';


const Home = () => {

    if(Cookies.get('user') === '') {
        return (
        <Register />

        )

    } else {
    return (
        <Fragment>
            <Nav />
            <br/><br /><br/>
            <Alert />
            <br/><br /><br/>
            <div className="container">
                    ddddddddddddddddddddd       
            </div>
        </Fragment>
    )
    }
}

export default Home
